import { useEffect, useState } from "react";
import CIVIC_INFO_API_KEY from './apiKeys';

function GetReps() {

    const [federalReps, setFederalReps] = useState([]);

    const getData = async () => {
        const apiUrl = 'https://www.googleapis.com/civicinfo/v2/representatives';
        const params = {
            address: '94501',
            includeOffices: true,
            levels: 'country',
            roles: ['legislatorLowerBody', 'legislatorUpperBody'],
            key: CIVIC_INFO_API_KEY,
        };
        const urlWithParams = `${apiUrl}?address=${params.address}&includeOffices=${params.includeOffices}&levels=${params.levels}&roles=${params.roles.join(',')}&key=${params.key}`;
        try {
            const response = await fetch(urlWithParams);
            if (!response.ok) {
                throw new Error(`HTTP error! Status: ${response.status}`);
            }
            const data = await response.json();
            setFederalReps(data.federalReps);
        } catch (error) {
            console.error('Error fetching data:', error);
        }
    };

    useEffect(() => {
        getData()
    }, []);

    console.log(federalReps);

    return (
        "hello world"
    );
};

export default GetReps;
